import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import AccountNavbar from "components/AccountNavbar/AccountNavbar.";
import { getAllOrderByUser } from "actions/services/OrderActions";
import { currency } from "utils/FormatCurrency";
import useTimeout from "hooks/useTimeout";
import Loading from "components/Loading/Loading";
import { getUserLogin } from "actions/services/UserActions";

export default function HistoryOrder(props) {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [user, setUser] = useState({
    id: "",
    fullName: "",
    username: "",
  });

  const getUser = () => {
    getUserLogin()
      .then((res) => {
        setUser(res.data);
      })
      .catch((err) => console.log(err));
  };
  useEffect(() => {
    document.title = "Đơn hàng của tôi";

    getUser();

    getAllOrderByUser()
      .then((res) => {
        setOrders(res);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  useTimeout(() => setLoading(false), loading ? 500 : null);
  return (
    <>
      <div
        className="row sm-gutter section__content"
        style={{ margin: "var(--header-height)", backgroundColor: "#FFFFFF" }}
      >
        <div className="col l-12 m-12 c-12">
          <div className="home-product">
            <div className="row sm-gutter section__item">
              <div className="col l-2-4 m-3 c-3">
                <AccountNavbar name={user?.fullName} />
              </div>
              <div className="col l-9-4 m-9 c-9">
                <div className="list-cusomer-order">
                  <div className="heading">Danh sách đơn hàng của tôi</div>
                  {loading ? (
                    <Loading />
                  ) : (
                    <table className="list__order-info">
                      <thead>
                        <tr>
                          <th>Mã đơn hàng</th>
                          <th>Ngày mua</th>
                          <th>Sản phẩm</th>
                          <th>Tổng tiền</th>
                          <th>Trạng thái đơn hàng</th>
                        </tr>
                      </thead>
                      <tbody>
                        {orders.map((item) => {
                          return (
                            <tr key={item.id}>
                              <td>
                                <Link
                                  to={`/customer/order/history/detail/${item.id}`}
                                  className="info-cusomer-order-link"
                                >
                                  {item.id}
                                </Link>
                              </td>
                              <td>{item.createdDate}</td>
                              <td>{item.description}</td>
                              <td>
                                {currency(item.total_price + item.ship_fee)}
                              </td>
                              <td>{item.status_order_name}</td>
                            </tr>
                          );
                        })}
                      </tbody>
                    </table>
                  )}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
